import React from "react";
import {
  Container,
  Title,
  CopyRightContainer,
  CopyRight,
  SubTitle,
} from "./styles";

export default function Footer({ title, subtitle }) {
  return (
    <Container>
      <Title>{title}</Title>
      <SubTitle>{subtitle}</SubTitle>
      <CopyRightContainer>
        <CopyRight>teste</CopyRight>
      </CopyRightContainer>
    </Container>
  );
}
